import { createGlobalStyle } from 'styled-components';

const GrayBg = createGlobalStyle`
    body {
        background-color: rgb(248, 248, 248);
        margin: 0;
        padding: 0;
        font-family: Arial, sans-serif;
    }
`;

export default GrayBg;
